    "policies" : MessageLookupByLibrary.simpleMessage("سياسة الخصوصية\n\nنقدر مخاوفكم واهتمامكم بشأن خصوصية بياناتكم على شبكة الإنترنت وعلى تطبيقنا مندوب مشتريات.\nيقوم مندوب مشتريات والذي قد نشير اليه في باقي البنود بالآتي (\"نحن\" أو \"تطبيقنا\") بجمع ومعالجة بياناتك الشخصية وفقًا لسياسة الخصوصية هذه وبما يتوافق مع قوانين حماية البيانات المعمول بها في المملكة العربية السعودية. تزودك هذه السياسة بالمعلومات اللازمة فيما يتعلق بحقوقك والتزاماتنا، وتشرح كيف ولماذا ومتى نعالج بياناتك الشخصية. مبدأنا العام هو جمع المعلومات الضرورية فقط لتزويدك بالوظائف الكاملة لمنتجاتنا وخدماتنا.\nلقد تم إعداد هذه السياسة لمساعدتكم على تفهم طبيعة هذه البيانات التي نقوم بتجميعها عنكم عند استخدامكم لتطبيقنا وكيفية تعاملنا مع هذه البيانات الشخصية. \nباستخدامك لتطبيقنا انت توافق على كل بنود سياسة الخصوصية الموضحة، وتلزمك هذه البنود بتقبل كافة الشروط والبنود المطبقة عليك مند تحميلك للتطبيق. \nوتلتزم إدارة التطبيق، وفق القانون المنظم محليا، ووفق قوانين حماية المعطيات والتي تقرها المنظمات الدولية بعدم كشف أي معلومات شخصية عن المستخدم لتطبيقنا مثل العنوان أو رقم الهاتف أو عنوان البريد الإلكتروني وغيرها. \nويلتزم تطبيقنا بعدم تبادل، أو تداول أي من تلك المعلومات أو بيعها لأي طرف آخر طالما كان ذلك في حدود قدرات إدارة التطبيق الممكنة، ولن يُسمح بالوصول إلى المعلومات إلا للأشخاص المؤهلين والمحترفين الذين يشرفون على تطبيقنا. \n \nاخلاء المسؤولية \nيقر المستخدم لتطبيقنا على انه المسؤول الحصري والوحيد على طبيعة الاستخدام لتطبيقنا وعلى سلامة المعطيات والمعلومات التي يدخلها او يقدمها للتطبيق، وتخلي ادارة التطبيق مسؤوليتها من كل ضرر او تسريب او اختلال يتعرض له المستخدم جراء استخدام تطبيقنا. . \n \nالاعلانات على التطبيق \nقد يشتمل تطبيقنا على روابط لمواقع أخرى على شبكة الإنترنت. او اعلانات من شركات اعلانية مثل أدموب ولا نعتبر مسؤولين عن أساليب تجميع البيانات من قبل تلك المواقع، يمكنك الاطلاع على سياسات الخصوصية والمحتويات الخاصة بتلك المواقع لتعرف طبيعة المعطيات التي تجمعها عنك. \nقد نستعين بشركات إعلانية لأطراف ثالثة لعرض الإعلانات عندما تزور تطبيقنا. يحق لهذه الشركات أن تستخدم معلومات حول زياراتك لتطبيقنا (باستثناء الاسم أو العنوان أو عنوان البريد الإلكتروني أو رقم الهاتف)، وذلك من أجل تقديم إعلانات حول البضائع والخدمات التي تهمك. \n \nحماية المعطيات الشخصية\nنحن نتبع إجراءات أمنية مادية وإلكترونية وتقنية وتدابير أمنية وتنظيمية مناسبة، بما في ذلك نماذج الحوكمة لحماية بياناتك الشخصية وفقا لقانون حماية البيانات من الوصول غير المصرح به إلى البيانات الشخصية أو استخدامها أو تغييرها أو الإفصاح عنها أو إتلافها.\nيرجى الملاحظة أنه لا يمكن ضمان نقل أية بيانات عبر الإنترنت أو التطبيق الإلكتروني من دون أي تدخل. بالإضافة إلى ذلك، عليك أيضا اتخاذ الإجراءات المناسبة لحماية بياناتك الشخصية. إن كنا نعلم أو لدينا سبب للاعتقاد أن بياناتك الشخصية قد تعرضت للاختراق، سوف نقوم فورا بإبلاغ المستخدمين المتضررين من حدوث خرق وفقا للقوانين المعمول بها.\n \nإفشاء المعلومات \nسنحافظ في كافة الأوقات على خصوصية وسرية كافة البيانات الشخصية التي نتحصل عليها. ولن يتم إفشاء هذه المعلومات إلا إذا كان ذلك مطلوباً بموجب أي قانون أو مذكرة قضائية، وفقط عندما نعتقد بحسن نية أن مثل هذا الإجراء سيكون مطلوباً أو مرغوباً فيه للتمشي مع القانون، أو للدفاع أو حماية حقوق الملكية الخاصة بهذا التطبيق أو الجهات المستفيدة منه. \n \nمحتوى تطبيقنا \nيلتزم الزائر بكل الشروط والبنود الموضحة في سياسة الخصوصية، ويلتزم بألا يستعمل تطبيقنا او خصائصه او أي شيء يدخل ضمن محتواه في أي شيء يخالف الشريعة الإسلامية بأي شكل من الأشكال، أو في أغراض غير قانونية، على سبيل المثال لا الحصر، مثل: القرصنة ونشر وتوزيع مواد أو برامج منسوخة، أو الخداع والتزوير أو الاحتيال أو التهديد أو إزعاج أي شخص أو شركة أو جماعة أو في نشر فيروسات أو ملفات تجسس أو وضع روابط إلى مواقع تحتوي على مثل هذه المخالفات.. \nيمنع انتهاك / استعمال أي جزء من تطبيقنا كصورة / فيديو / رابط او أي شيء اخر في نشاط ينتهك حقوق الملكية الفكرية أو تشويه سمعة شخص أو مؤسسة أو شركة أو تعمد نشر أي معلومات تسبب ضررا لشركة أو شخص أو دولة أو جماعة وبعدم وضع أي جزء من تطبيقنا على أي تطبيق او موقع يحتوي على مواد قرصنة وبرامج مسروقة وجميع ما يخالف الأعراف والقوانين المنظمة.\n \nالتعديلات على البنود \nنحتفظ بالحق في تعديل بنود وشروط سياسة الخصوصية وشروط الاستخدام دون الحاجة الى اشعارك وستعتبر التغييرات في البنود على هذه الصفحة بمثابة الاشعار لكل زائر يدخل تطبيقنا لذلك احرص على مواكبة قراءة هذه الصفحة لتعلم بجديد التغييرات. \n \nالاتصال بنا \nيمكنكم الاتصال بنا عند الحاجة من خلال الصفحة المخصصة لذلك او عبر بريدنا الالكتروني، وستحتاج للقيام بهذه العملية لإدخال بريدك الالكتروني واسمك وبضع معلومات أخرى ضرورية، ويلتزم تطبيقنا بعدم مشاركة المعلومات المدخلة مع أي طرف كان. \n \nاخيرا \nإن مخاوفك واهتمامك بشأن خصوصية البيانات تعتبر مسألة في غاية الأهمية بالنسبة لنا. نحن نأمل أن يتم تبديد كل مخاوفك وتوضيح مسارات كافة معطياتك من خلال هذه الصفحة. \n"),
