    "termOfServiceMessage" : MessageLookupByLibrary.simpleMessage("شروط الاستخدام \nتتغير شروط استخدام تطبيق مندوب مبيعات باستمرار فـأحرص على مداومة زيارة هذه الصفحة كي تبقى على اطلاع بالتغييرات، بتحميلك واستعمالك لتطبيقنا فانت توافق ضمنيا على الشروط والاحكام الموضحة في هذه الصفحة. \nكافة الشروط والبنود المبينة في هذه الصفحة لا تتنافى مع أي من القوانين الجاري بها العمل أو قوانين انتهاك الخصوصية والملكية الفكرية والملكية المشتركة المعمول بها دوليا. ويمكنكم معرفة المزيد عن هذا عبر مطالعة بنود \"سياسة الخصوصية\" \nسياسة وشروط الاستخدام هذه تخص حصرا تطبيق مشتريات مبيعات، وكل ما يندرج ضمنها من بنود ساري على تطبيقنا فقط واي بند لا تتضمنه الصفحة فانه لا يلزم وجوبا تطبيقنا بتبنيه او اتباعه، سنشير الى تطبيقنا مندوب مشتريات في باقي البنود باسم (التطبيق، او نحن)، ونحن لا نتحمل مسؤولية اي ضرر عند اساءة استخدام تطبيقنا او استعماله بما لا يتناسب مع البنود المدرجة اسفله.\nالبنود الواجب عليك الالتزام بها: \n \n(1) تقديم: \nمرحبا بكم في تطبيقنا، فيما يلي الشروط والأحكام التي تخص استخدامك ودخولك لتطبيقنا: \nإن دخولك واستخدامك لتطبيقنا هو موافقة منك على القبول ببنود وشروط هذه الاتفاقية والتي تشمل كافة التفاصيل أدناه وهو تأكيد لالتزامك بالاستجابة لمضمون هذه الاتفاقية الخاصة بـتطبيقنا والمشار إليه فيما يلي باسم \"نحن\" والمشار اليها أيضا بالـ \"التطبيق\"، في باقي بنود \"هذه الصفحة\" وتعتبر هذه الاتفاقية سارية المفعول حال تحميلك للتطبيق. \n \n(2) العضوية: \nيتوفر تطبيقنا على نظام عضويات يتيح لك بعد التسجيل فيه الدخول على تطبيقنا والتعرف على تجار البيع بالجملة وكذا إيجاد المصانع والمعامل التي تنتج منتجات وسواء كنت فردا او شركة فيمكنك ربط الاتصال بالتجار المنضوين تحت تطبيقنا يكفي ان تكون مسجلا على التطبيق وتكون قد ادليت بكافة المعلومات المطلوبة منك من قبيل البريد الالكتروني والاسم واي معلومة أخرى قد نراها مناسبة.\n \n(3) مزودو الخدمة: \nيحق لنا أن نوظف شركات وأفراد وحتى خدمات الكترونية من أطراف ثالثة لتسهيل إدارة تطبيقنا (\"إدارة العضويات كمثال\")، أو تقديم الخدمة نيابة عنا، أو لمساعدتنا في تحليل كيفية استخدام خدمتنا. \nويحق لهذه الأطراف الثالثة الوصول إلى بياناتك الشخصية فقط لأداء هذه المهام نيابة عنا، وهي ملزمة بعدم الكشف عنها أو استخدامها لأي غرض آخر. \n \n(4) التعديل على الشروط والأحكام: \n1. أنت تعلم وموافق على أن يقوم تطبيقنا بأي تعديل على اتفاقية الشروط والأحكام، وبموجبه تتضاعف التزاماتك أو تتضاءل حقوقك وفقاً لأي تعديلات قد تجرى على اتفاقية الشروط والأحكام دون الحاجة الى اعلامك. \n2. أنت توافق على ان تطبيقنا يملك بمطلق صلاحيته ودون تحمله المسؤولية القانونية أن يجري تعديلات أساسية أو فرعية على هذه الاتفاقية دون أن يتطلب ذاك موافقة إضافية من طرفك، وذلك في أي وقت وبأثر فوري، دون إلزام بأخبارك، ويمكنك دائما معرفة التعديلات عبر الرجوع لهذه الصفحة. \n3. أنت توافق على ان تطبيقنا يعتبر تطبيق إلكترونيا تقنيا يتيح للمستخدم إيجاد تجار ومصانع تعرض خدماتها ومنتجاتها حيت يعمل تطبيقنا كوسيط بينك وبينهم.\n4. لا يقدم تطبيقنا خدمة مدفوعة ولكن يحصل التطبيق على نسبة من كل عملية بيع تتم داخل التطبيق وانت مطالب بأداء هذه النسبة عبر الوسائل المتوفرة لذلك.\n5. قد نستعمل اعلانات من أطراف ثالثة. \n \n(5) معلوماتك الشخصية: \n توافق على ان لتطبيقنا الحق في التصرف في معلوماتك ضمن ما هو محدد في بنود شروط الاستخدام وفي بنود سياسة الخصوصية، بشكل دائم وغير قابل للإلغاء، وذلك من خلال التسجيل او استعمال النماذج المخصصة للتواصل، أو عبر أية رسالة إلكترونية أو أي من قنوات الاتصال المتاحة بالتطبيق. وذلك بهدف تشغيل وترويج التطبيق وفق اتفاقية إخلاء المسئولية وبيان الخصوصية. \n \n(6) حقوق الطبع: \n1.كافة المحتويات التي يتضمنها التطبيق، بما في ذلك وليس محصوراً في النصوص، التصاميم الجرافيكية، الشعارات، أيقونات الأزرار، الرموز، المقاطع الصوتية، الأحمال الرقمية، البيانات المجمّعة والبرامج الإلكترونية، هي ملك وحقوقها محفوظة إما لـتطبيقنا أو للجهة المسؤولة عن تصميم تطبيقنا، والمعدين لهذه المحتويات وللمفوضين وهي محمية ضمن حقوق الملكية الفكرية والإبداعية. \n \n(7) سرية المعطيات: \n1.يتخذ تطبيقنا معايير (ملموسة وتنظيمية وتكنولوجية) للحماية من وصول شخص غير مفوض إلى معلومات هويتك الشخصية، وحفظها.\n 2. تطبيقنا ليس له سيطرة على أفعال أي طرف ثالث، مثل صفحات الانترنت الأخرى الموصولة بهذا التطبيق، او الاعلانات أو اي أطراف ثالثة. \n3.أنت تعلم وموافق أن تطبيقنا قد يستخدم معلوماتك التي زودته بها، بهدف تحسين الخدمات المقدمة لك، ولإرسال رسائل تسويقية لك، وان بيان الخصوصية في هذا التطبيق يضبط عمليات الجمع والمعالجة والاستخدام والتحويل لمعلومات هويتك الشخصية. \n \n \n(8) نقض اتفاقية الشروط والأحكام: \nان ادارة تطبيقنا بحسب اتفاقية الشروط والأحكام وبحسب القانون قد يلجأ إلى وقف مؤقت أو دائم للمحتوى وللخدمة التي يقدمها مهما كانت أو الى إلغاء وصولك إلى التطبيق دون الإضرار بحقوقه الأخرى ووسائله المشروعة في استرداد حقوقك في حالة: \n1. إذا انتهكت اتفاقية الشروط والأحكام. \n2. إذا اكتشفنا أن نشاطاتك قد تتسبب لك أو لمستخدمين آخرين ولـتطبيقنا في إشكالات قانونية. \n3. في حالة القرصنة او محاولة القرصنة لتطبيقنا فأننا نحتفظ بكامل الحق في اتخاذ الإجراءات القانونية و/أو اللجوء الى القضاء حسبما تراه ادارة التطبيق مناسباً. \n4. إن قيامك أو قيام آخرين بانتهاك الاتفاقية هذه لا يلزم تطبيقنا بالتنازل عن حقه في اتخاذ الإجراءات المناسبة لمثل هذا الفعل ولغيره من أفعال الانتهاك المشابهة. وتطبيقنا لا يضمن اتخاذه إجراءات ضد كل الانتهاكات لاتفاقية الشروط والأحكام. \n \n \n(9) محتويات غير قانونية: \nممنوع منعا كليا استخدام خصائص التطبيق او محتوياته او صوره او أي شيء يدخل ضمن تطبيقنا في أي نشاط غير قانوني او من اجل الدعاية او الخداع او النصب باسم التطبيق او تشهير بشخص او شركة من خلال أي جزء من التطبيق، ويعتبر ذلك بمثابة انتهاك للشروط والأحكام. \n \n(10) التغذية الرجعية: \nتطبيقنا يشجع جميع الأعضاء على التطبيق لتقديم مساهمات (فيد باك Feedback) من شأنها المساعدة على تطوير تطبيقنا او المحتوى المقدم وذلك عبر مراسلتنا، وسوف نحرص على اخدها بعين الاعتبار كي نطور من التطبيق ومن سهولة استخدامه.\n \n(11) إلغاء الوصول: \nبدون إلحاق الضرر بحقوقه الأخرى ووسائله المشروعة لاسترداد حقوقه، يمكن لـتطبيقنا وقف أو إلغاء وصولك لعضويتك في أي وقت وبدون إنذار ولأي سبب، ودون تحديد، ويمكنه أيضا إلغاء اتفاقية الشروط والأحكام هذه. \n \n(12) تحديد المسؤوليات: \nبحسب ما هو مسموح في القانون فإن تطبيقنا وموظفيه ومدراءه والمتفرعين عنه والمجهزين له لن يكونوا مسؤولين عن أي خسارة مباشرة أو غير مباشرة أو أعطال تنشأ عن استخدامك للتطبيق. إذا لم تكن راض عن التطبيق أو عن أي من محتوياته فالحل هو بعدم استمرارك باستخدامه، علاوة على ذلك فأنت موافق أن أي استخدام غير مفوض للتطبيق وخدماته، بسبب إهمالك سوف يتسبب بإلحاق الأذى بـتطبيقنا، وعليه سيضطر التطبيق حينها إلى اللجوء إلى الشروط والأحكام. \n \n(13) الأمان: \nأنت موافق على استخدامك الأمن لتطبيقنا مع الحفاظ على امن مدراءه وموظفيه ووكلائه ومجهزيه ووقايتهم من أي ضرر قد يلحق بهم جراء مطالبات وخسائر وأعطال وتكاليف ونفقات، تحدث بسبب انتهاك لاتفاقية الشروط والأحكام أو خرقك لأي قانون أو تعديلات أو تعدي على حقوق أطراف ثالثة. \n \n(14) العلاقة والإشعارات: \nلا تتضمن أي من بنود اتفاقية الشروط والأحكام إشارة إلى وجود شراكة بينك وبين التطبيق. وأنت ليس لك سلطة في إلزام تطبيقنا بأي حال من الأحوال، وأن أي إشعارات تود إرسالها لـتطبيقنا، عليك إرسالها بالبريد الإلكتروني، دون إلزام لتطبيقنا بالرد او عدم الرد على الرسالة الإلكترونية. أنت تعرف وموافق على أن أية إشعارات ترسل إليك من تطبيقنا سوف تعلن على التطبيق أو بواسطة البريد الإلكتروني الذي زودتنا به خلال عملية التسجيل. \n \n(15) تحويل الحقوق والالتزامات: \nأنت هنا تمنح تطبيقنا الحق في تحويل جزء أو كل حقوقه ومنافعه والتزاماته ومسؤولياته، إلى أطراف أخرى تعمل معه، دون الحاجة للرجوع إليك، وذلك بحسب نصوص اتفاقية الشروط والحكام، وتطبيقنا ملتزم بإشعارك عن مثل هذه التحويلات إذا حصلت عبر هذه الصفحة. \n \n \n(16) معلومات عامة: \nإذا كانت أية فقرة واردة في اتفاقية الشروط والأحكام هذه غير صالحة أو ملغاة أو أنها لأي سبب لم تعد نافذة، فإن مثل هذه الفقرة لا تلغي صلاحية بقية الفقرات الواردة في الاتفاقية. هذه الاتفاقية (والتي تعدل بين حين وآخر بحسب بنودها) تضع كافة الخطوط العريضة للتفاهم والاتفاق بينك وبين تطبيقنا مع الاعتبار لما يلي: \n•\t-ليس من حق أي شخص لا يكون طرفاً في هذه الاتفاقية أن يفرض أية بنود أو شروط فيها. \n•\t-إذا تمت ترجمة اتفاقية الشروط والأحكام لأي لغة أخرى، سواء على التطبيق أو بطرق أخرى، فإن النص العربي لها يظل هو السائد. \n \n(17) المحتوى: \nتطبيقنا عبارة عن وسيط بين المصانع و الموردين لبيع المنتجات بالتجزئة لكن هذا لا يمنع انه قد يضم محتوى اخر حسب ما تراه ادارة التطبيق مناسبا.\n \n(18) القانون والتشريع الحاكمان: \nاتفاقية الشروط والأحكام هذه محكومة ومصاغة بما يتوافق مع القوانين المحلية، وهي خاضعة تماماً وكلياً للتشريع المعمول به في المحاكم بالمملكة العربية السعودية، وهذه الفقرة توجد بديلاً يتم اللجوء إليه في حال انتهاء مفعول اتفاقية الشروط والأحكام هذه أو إلغاؤها لأي سبب كان. \n \n(19) التغييرات: \nنحتفظ - وفقًا لتقديرنا الخاص - بحق تعديل أو استبدال هذه الشروط في أي وقت. وإذا كانت المراجعة تخص مادة من المواد، فسوف نحاول تقديم إشعار قبل 30 يومًا على الأقل من تفعيل أي شروط جديدة. وسيتم تحديد ما يشكل التغيير المادي وفقًا لتقديرنا فقط. \nومن خلال الاستمرار في الوصول إلى خدمتنا أو استخدامها بعد أن تصبح تلك المراجعات فعالة، فإنك توافق على الالتزام بالشروط المعدلة. \n \n(20) إخلاء المسئولية: \nإن استخدامك للخدمة يقع على مسؤوليتك وحدك. ويتم توفير الخدمة \"كما هي\" وبناء على \"ما هو متوفر\". وإلى الحد الأقصى المسموح به وفقًا للقانون المعمول به، يتم توفير الخدمة بدون ضمانات من أي نوع، سواء كانت صريحة أو ضمنية، بما في ذلك على سبيل المثال لا الحصر، الضمانات الخاصة بالتسويق أو الملاءمة لغرض معين أو عدم الانتهاك أو دورة الأداء. \nلا يضمن تطبيقنا: (أ) عدم انقطاع الخدمة؛ (ب) أو عدم حدوث أي أخطاء أو عيوب؛ (ج) أو خلو التطبيق من الفيروسات أو المكونات الضارة الأخرى؛ (د) أو إيفاء الخدمة لمتطلباتك. \n \nفي حالة كان لديك استفسار المرجو مراسلتنا، وفي حال كنت غير موافق على أي من البنود سواء في سياسة الخصوصية او شروط الاستخدام او كافتها المرجو التوقف عن استخدام التطبيق. \n"),
